import React from "react";
// nodejs library that concatenates classes
import classNames from "classnames";
// react plugin used to create charts
import { Line, Bar, Doughnut } from "react-chartjs-2";

// reactstrap components
import {
  Button,
  ButtonGroup,
  Card,
  CardHeader,
  CardBody,
  CardTitle,
  DropdownToggle,
  DropdownMenu,
  DropdownItem,
  UncontrolledDropdown,
  Label,
  FormGroup,
  Input,
  Table,
  Row,
  Col,
  UncontrolledTooltip, Container
} from "reactstrap";

// core components
import {
  chartExample1,
  chartAppointment,
  chartExample3,
  chartExample4
} from "variables/charts.js";

class Settings extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      bigChartData: "data1"
    };
  }
  render() {
    return (
      <>
        <div className="content">
        <Row>
            <Col md="3">
              <Card>
                <CardHeader>
                  <CardTitle tag="h3">
                    Personal Details
                  </CardTitle>
                </CardHeader>
                <CardBody>
                <img
                        alt="..."
                        src={require("assets/img/icon_wallet.png")}
                      />
                </CardBody>
              </Card>
            </Col>
            <Col lg="3">
              <Card className="card-chart">
                <CardHeader>
                  <h5 className="card-category">Total Earnings</h5>
                  <CardTitle tag="h3">
                    <i className="tim-icons icon-money-coins text-success" /> 3,500â‚¬
                  </CardTitle>
                </CardHeader>
                <CardBody>
                  <div className="chart-area">
                    <Line
                      data={chartExample4.data}
                      options={chartExample4.options}
                    />
                  </div>
                </CardBody>
              </Card>
            </Col>

          </Row>
        </div>
      </>
    );
  }
}

export default Settings;
